import { yellow } from "@material-ui/core/colors";
import { sizeHeight } from "@material-ui/system";

export const styles = () => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      background: "yellow"
    }
  },
  root: {
    background: "blue"
  },
  container: {
    background: "green",
    maxWidth: 1280,
    margin: "auto"
  },
  lowerNav: {
    '& > $container': {
      height: 66
    }

  },
  upperNav: {
    '& > $container': {
      height: 44
    }
  }
});
